import { useState } from "react";
import { useHistory } from "react-router-dom";
import styles from "../home.module.css";

function App() {
  const history = useHistory();

  const [ProductIdAuth, setAuthProductId] = useState("");

  async function AuthenticateProduct(event) {
    event.preventDefault();

    const response = await fetch(
      'http://localhost:4000/channels/mychannel/chaincodes/smartContract?args=["' +
        ProductIdAuth +
        '"]&peer=peer0.org1.example.com&fcn=authenticate',
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
      }
    )
      .then(function (response) {
        return response.json();
      })
      .then(function (data) {
        alert("Product query successful");
        console.log(data);

        let container = document.getElementById("container");

        let table = document.createElement("table");

        for (let i = 0; i < data.length; i++) {
          let obj = data[i];
          let tr = document.createElement("tr");
          obj.forEach((elem) => {
            let td = document.createElement("td");
            td.innerText = elem;
            tr.appendChild(td);
          });
          table.appendChild(tr);
        }
        container.appendChild(table);
      })
      .catch((error) => console.error("Error:", error));
  }

  return (
    <div>
      <div class={styles.topnav}>
        <a href="/">Home</a>
        <a href="register">Register</a>
        <a href="login">Login</a>
        <a href="addproduct">Add Product</a>
        <a href="addseller">Add Seller</a>
        <a href="changeowner">Change Owner</a>
        <a class={styles.active} href="authenticate">
          Authenticate
        </a>
        <a href="queryall">Query All Products</a>
        <a href="queryprod">Query Product</a>
        <a href="addconsumer">Add Consumer</a>
        <a href="queryownerprod">Query Product Owner</a>
        <a href="queryseller">Query Seller</a>
        <a href="queryconsumer">Query Consumer</a>
        <a href="querytransaction">Query Transaction</a>
        <a href="queryassethistory">Query Asset</a>
      </div>
      <h1>Authenticate Product</h1>
      <form onSubmit={AuthenticateProduct}>
        <input
          value={ProductIdAuth}
          onChange={(e) => setAuthProductId(e.target.value)}
          type="text"
          placeholder="Product"
        />
        <br />
        <input type="submit" value="Authenticate" />

        <h4 id="prod"></h4>
        <input type="submit" value="Query Product" />
        <thead>
          <th>Item</th>
          <th>Product Id</th>
          <th>Product Name</th>
          <th>Brand</th>
          <th>Color</th>
          <th>Price</th>
          <th>Size</th>
          <th>Owner</th>
          <th>SellerId</th>
        </thead>
        <container id="container"></container>
      </form>
    </div>
  );
}

export default App;
